import React from 'react';
import './canon.css';
import {StickCard} from '../../stickCard/StickCard';


export const Canon = () =>{
	return(
		<div className="Canon">
			<StickCard title="Episódio I" imageName="ep1"/>
			<StickCard title="Episódio II"/>
			<StickCard title="Episódio III"/>
			<StickCard title="Episódio IV"/>
			<StickCard title="Episódio V"/>
			<StickCard title="Episódio VI"/>
		</div>
	);
}
